--
-- Name: calculate_tutor_review_rating(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.calculate_tutor_review_rating() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
            BEGIN
                -- Calculate rating as average of 4 factors
                -- Use COALESCE to handle NULL values (treat as 0)
                NEW.rating := (
                    COALESCE(NEW.subject_understanding_rating, 0) +
                    COALESCE(NEW.communication_rating, 0) +
                    COALESCE(NEW.discipline_rating, 0) +
                    COALESCE(NEW.punctuality_rating, 0)
                ) / 4.0;

                RETURN NEW;
            END;
            $$;


--
-- Name: get_campaign_engagement_counts(integer); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.get_campaign_engagement_counts(p_campaign_id integer) RETURNS TABLE(likes_count bigint, shares_count bigint, comments_count bigint, saves_count bigint, bookmarks_count bigint, total_engagements bigint)
    LANGUAGE plpgsql
    AS $$
            BEGIN
                RETURN QUERY
                SELECT
                    COUNT(CASE WHEN engagement_type = 'like' THEN 1 END) as likes_count,
                    COUNT(CASE WHEN engagement_type = 'share' THEN 1 END) as shares_count,
                    COUNT(CASE WHEN engagement_type = 'comment' THEN 1 END) as comments_count,
                    COUNT(CASE WHEN engagement_type = 'save' THEN 1 END) as saves_count,
                    COUNT(CASE WHEN engagement_type = 'bookmark' THEN 1 END) as bookmarks_count,
                    COUNT(*) as total_engagements
                FROM campaign_engagement
                WHERE campaign_id = p_campaign_id;
            END;
            $$;


--
-- Name: get_campaign_payment_status(integer); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.get_campaign_payment_status(p_campaign_id integer) RETURNS character varying
    LANGUAGE plpgsql
    AS $$
            DECLARE
                v_outstanding NUMERIC;
                v_deposit_paid BOOLEAN;
            BEGIN
                SELECT
                    SUM(outstanding_amount),
                    COALESCE(MAX(CASE WHEN invoice_type = 'deposit' AND status = 'paid' THEN TRUE ELSE FALSE END), FALSE)
                INTO v_outstanding, v_deposit_paid
                FROM campaign_invoices
                WHERE campaign_id = p_campaign_id;

                IF v_outstanding IS NULL THEN
                    RETURN 'no_invoices';
                ELSIF v_outstanding = 0 THEN
                    RETURN 'fully_paid';
                ELSIF NOT v_deposit_paid THEN
                    RETURN 'deposit_pending';
                ELSE
                    RETURN 'partially_paid';
                END IF;
            END;
            $$;


--
-- Name: get_campaign_primary_image(integer); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.get_campaign_primary_image(p_campaign_id integer) RETURNS character varying
    LANGUAGE plpgsql
    AS $$
            BEGIN
                RETURN (
                    SELECT file_url
                    FROM campaign_media
                    WHERE campaign_id = p_campaign_id
                    AND media_type = 'image'
                    ORDER BY
                        CASE WHEN placement = 'widget' THEN 0
                             WHEN placement = 'placeholder' THEN 1
                             WHEN placement = 'popup' THEN 2
                             WHEN placement = 'insession' THEN 3
                             ELSE 4
                        END,
                        created_at ASC
                    LIMIT 1
                );
            END;
            $$;


--
-- Name: has_user_engaged(integer, integer, character varying); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.has_user_engaged(p_campaign_id integer, p_user_id integer, p_engagement_type character varying) RETURNS boolean
    LANGUAGE plpgsql
    AS $$
            BEGIN
                RETURN EXISTS (
                    SELECT 1 FROM campaign_engagement
                    WHERE campaign_id = p_campaign_id
                    AND user_id = p_user_id
                    AND engagement_type = p_engagement_type
                );
            END;
            $$;


--
-- Name: notes_search_vector_update(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.notes_search_vector_update() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
            BEGIN
                NEW.search_vector :=
                    setweight(to_tsvector('english', COALESCE(NEW.title, '')), 'A') ||
                    setweight(to_tsvector('english', COALESCE(NEW.content, '')), 'B') ||
                    setweight(to_tsvector('english', COALESCE(NEW.course, '')), 'C') ||
                    setweight(to_tsvector('english', COALESCE(NEW.tutor, '')), 'C') ||
                    setweight(to_tsvector('english', COALESCE(NEW.tags, '')), 'D');
                RETURN NEW;
            END;
            $$;


