--
-- Name: update_days_overdue(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.update_days_overdue() RETURNS void
    LANGUAGE plpgsql
    AS $$
        BEGIN
            UPDATE user_investments
            SET days_overdue = GREATEST(0, CURRENT_DATE - due_date)
            WHERE payment_status IN ('pending', 'late')
            AND due_date IS NOT NULL
            AND due_date < CURRENT_DATE;

            -- Update payment_status to 'late' if overdue
            UPDATE user_investments
            SET payment_status = 'late'
            WHERE payment_status = 'pending'
            AND due_date < CURRENT_DATE;
        END;
        $$;


--
-- Name: FUNCTION update_days_overdue(); Type: COMMENT; Schema: public; Owner: -
--

COMMENT ON FUNCTION public.update_days_overdue() IS 'Updates days_overdue field for all overdue payments. Run this daily via cron job.';


