--
-- Name: campaign_with_full_metrics; Type: VIEW; Schema: public; Owner: -
--

CREATE VIEW public.campaign_with_full_metrics AS
 SELECT id,
    name,
    description,
    objective,
    is_verified,
    verification_status,
    status_by,
    status_reason,
    status_at,
    start_date,
    target_location,
    campaign_socials,
    submitted_date,
    created_at,
    updated_at,
    call_to_action,
    target_audiences,
    target_regions,
    target_placements,
    cpi_rate,
    total_charged,
    billing_frequency,
    auto_pause_on_low_balance,
    minimum_balance_threshold,
    launched_at,
    ended_at,
    pause_reason,
    advertiser_id,
    brand_id,
    cancellation_fee_percent,
    campaign_budget,
    amount_used,
    remaining_balance,
    cancellation_fee_amount,
    cancelled_by_user_id,
    cancellation_reason,
    paused_at,
    grace_period_hours,
    deposit_percent,
    deposit_amount,
    outstanding_balance,
    total_impressions_planned,
    final_settlement_amount,
    national_location,
    national_country_code,
    regional_country_code,
    ( SELECT count(*) AS count
           FROM public.campaign_impressions
          WHERE (campaign_impressions.campaign_id = c.id)) AS impressions,
    ( SELECT count(*) AS count
           FROM public.campaign_impressions
          WHERE ((campaign_impressions.campaign_id = c.id) AND (campaign_impressions.charged = true))) AS impressions_delivered,
    ( SELECT count(DISTINCT campaign_impressions.user_id) AS count
           FROM public.campaign_impressions
          WHERE (campaign_impressions.campaign_id = c.id)) AS reach,
    ( SELECT count(*) AS count
           FROM public.campaign_impressions
          WHERE ((campaign_impressions.campaign_id = c.id) AND (campaign_impressions.clicked = true))) AS clicks,
    ( SELECT count(*) AS count
           FROM public.campaign_impressions
          WHERE ((campaign_impressions.campaign_id = c.id) AND (campaign_impressions.converted = true))) AS conversions,
    ( SELECT count(*) AS count
           FROM public.campaign_engagement
          WHERE ((campaign_engagement.campaign_id = c.id) AND ((campaign_engagement.engagement_type)::text = 'like'::text))) AS likes,
    ( SELECT count(*) AS count
           FROM public.campaign_engagement
          WHERE ((campaign_engagement.campaign_id = c.id) AND ((campaign_engagement.engagement_type)::text = 'share'::text))) AS shares,
    ( SELECT count(*) AS count
           FROM public.campaign_engagement
          WHERE ((campaign_engagement.campaign_id = c.id) AND ((campaign_engagement.engagement_type)::text = 'comment'::text))) AS comments,
    ( SELECT count(*) AS count
           FROM public.campaign_engagement
          WHERE ((campaign_engagement.campaign_id = c.id) AND ((campaign_engagement.engagement_type)::text = 'save'::text))) AS saves,
    ( SELECT count(*) AS count
           FROM public.campaign_engagement
          WHERE ((campaign_engagement.campaign_id = c.id) AND ((campaign_engagement.engagement_type)::text = 'bookmark'::text))) AS followers,
    ( SELECT round((((count(
                CASE
                    WHEN campaign_impressions.is_viewable THEN 1
                    ELSE NULL::integer
                END))::numeric / (NULLIF(count(*), 0))::numeric) * (100)::numeric), 2) AS round
           FROM public.campaign_impressions
          WHERE (campaign_impressions.campaign_id = c.id)) AS viewability_rate,
    ( SELECT round((((count(
                CASE
                    WHEN campaign_impressions.clicked THEN 1
                    ELSE NULL::integer
                END))::numeric / (NULLIF(count(*), 0))::numeric) * (100)::numeric), 2) AS round
           FROM public.campaign_impressions
          WHERE (campaign_impressions.campaign_id = c.id)) AS click_through_rate,
    ( SELECT round((((count(
                CASE
                    WHEN campaign_impressions.converted THEN 1
                    ELSE NULL::integer
                END))::numeric / (NULLIF(count(*), 0))::numeric) * (100)::numeric), 2) AS round
           FROM public.campaign_impressions
          WHERE (campaign_impressions.campaign_id = c.id)) AS conversion_rate,
    ( SELECT round(((((count(
                CASE
                    WHEN (campaign_impressions.clicked OR campaign_impressions.converted) THEN 1
                    ELSE NULL::integer
                END) + COALESCE(( SELECT count(*) AS count
                   FROM public.campaign_engagement
                  WHERE (campaign_engagement.campaign_id = c.id)), (0)::bigint)))::numeric / (NULLIF(count(*), 0))::numeric) * (100)::numeric), 2) AS round
           FROM public.campaign_impressions
          WHERE (campaign_impressions.campaign_id = c.id)) AS engagement_rate,
    ( SELECT round(((count(*))::numeric / (NULLIF(count(DISTINCT campaign_impressions.user_id), 0))::numeric), 2) AS round
           FROM public.campaign_impressions
          WHERE (campaign_impressions.campaign_id = c.id)) AS frequency,
    ( SELECT round(((count(
                CASE
                    WHEN ci.converted THEN 1
                    ELSE NULL::integer
                END))::numeric / NULLIF(( SELECT COALESCE(sum(campaign_invoices.amount), (0)::numeric) AS "coalesce"
                   FROM public.campaign_invoices
                  WHERE ((campaign_invoices.campaign_id = c.id) AND ((campaign_invoices.status)::text = 'paid'::text))), (0)::numeric)), 4) AS round
           FROM public.campaign_impressions ci
          WHERE (ci.campaign_id = c.id)) AS marketing_efficiency_ratio
   FROM public.campaign_profile c;


--
-- Name: campaign_with_media; Type: VIEW; Schema: public; Owner: -
--

CREATE VIEW public.campaign_with_media AS
 SELECT id,
    name,
    description,
    objective,
    is_verified,
    verification_status,
    status_by,
    status_reason,
    status_at,
    start_date,
    target_location,
    campaign_socials,
    submitted_date,
    created_at,
    updated_at,
    call_to_action,
    target_audiences,
    target_regions,
    target_placements,
    cpi_rate,
    total_charged,
    billing_frequency,
    auto_pause_on_low_balance,
    minimum_balance_threshold,
    launched_at,
    ended_at,
    pause_reason,
    advertiser_id,
    brand_id,
    cancellation_fee_percent,
    campaign_budget,
    amount_used,
    remaining_balance,
    cancellation_fee_amount,
    cancelled_by_user_id,
    cancellation_reason,
    paused_at,
    grace_period_hours,
    deposit_percent,
    deposit_amount,
    outstanding_balance,
    total_impressions_planned,
    final_settlement_amount,
    national_location,
    national_country_code,
    regional_country_code,
    ( SELECT campaign_media.file_url
           FROM public.campaign_media
          WHERE ((campaign_media.campaign_id = c.id) AND ((campaign_media.media_type)::text = 'image'::text))
          ORDER BY campaign_media.created_at
         LIMIT 1) AS first_image_url,
    ( SELECT campaign_media.file_url
           FROM public.campaign_media
          WHERE ((campaign_media.campaign_id = c.id) AND ((campaign_media.media_type)::text = 'video'::text))
          ORDER BY campaign_media.created_at
         LIMIT 1) AS first_video_url,
    ( SELECT json_agg(json_build_object('id', campaign_media.id, 'type', campaign_media.media_type, 'url', campaign_media.file_url, 'placement', campaign_media.placement, 'size', campaign_media.file_size) ORDER BY campaign_media.created_at DESC) AS json_agg
           FROM public.campaign_media
          WHERE (campaign_media.campaign_id = c.id)) AS all_media
   FROM public.campaign_profile c;


