--
-- Name: enrollment_payments; Type: VIEW; Schema: public; Owner: -
--

CREATE VIEW public.enrollment_payments AS
 SELECT es.id AS enrollment_id,
    es.tutor_id,
    t.user_id AS tutor_user_id,
    es.student_id,
    s.user_id AS student_user_id,
    es.package_id,
    tp.name AS package_name,
    tp.hourly_rate AS package_hourly_rate,
    es.agreed_price,
    es.payment_status,
    es.payment_due_date,
    es.payment_received_date,
    es.total_sessions,
    es.completed_sessions,
    es.cancelled_sessions,
    es.enrolled_at,
        CASE
            WHEN (((es.payment_status)::text = 'pending'::text) AND (es.payment_due_date < CURRENT_DATE)) THEN true
            ELSE false
        END AS is_overdue,
        CASE
            WHEN (es.payment_due_date IS NOT NULL) THEN (CURRENT_DATE - es.payment_due_date)
            ELSE 0
        END AS days_overdue
   FROM (((public.enrolled_students es
     LEFT JOIN public.tutor_profiles t ON ((t.id = es.tutor_id)))
     LEFT JOIN public.student_profiles s ON ((s.id = es.student_id)))
     LEFT JOIN public.tutor_packages tp ON ((tp.id = es.package_id)))
  WHERE (es.payment_status IS NOT NULL);


--
-- Name: VIEW enrollment_payments; Type: COMMENT; Schema: public; Owner: -
--

COMMENT ON VIEW public.enrollment_payments IS 'Shows all enrollment payments with calculated overdue status';


