--
-- Name: overdue_payments; Type: VIEW; Schema: public; Owner: -
--

CREATE VIEW public.overdue_payments AS
 SELECT ui.id,
    ui.user_id,
    u.first_name,
    u.father_name,
    u.roles,
    ui.investment_type,
    ui.subscription_plan_id,
    ui.student_payment_id,
    ui.amount,
    ui.due_date,
    ui.payment_status,
    ui.days_overdue,
    ui.late_fee,
    (CURRENT_DATE - ui.due_date) AS actual_days_overdue
   FROM (public.user_investments ui
     JOIN public.users u ON ((u.id = ui.user_id)))
  WHERE (((ui.payment_status)::text = ANY ((ARRAY['pending'::character varying, 'late'::character varying])::text[])) AND (ui.due_date < CURRENT_DATE))
  ORDER BY ui.due_date;


--
-- Name: VIEW overdue_payments; Type: COMMENT; Schema: public; Owner: -
--

COMMENT ON VIEW public.overdue_payments IS 'Shows all overdue payments with user details and days overdue. subscription_plan_id references admin_db';


