--
-- Name: campaign_with_payment_summary _RETURN; Type: RULE; Schema: public; Owner: -
--

CREATE OR REPLACE VIEW public.campaign_with_payment_summary AS
 SELECT c.id,
    c.name,
    c.description,
    c.objective,
    c.is_verified,
    c.verification_status,
    c.status_by,
    c.status_reason,
    c.status_at,
    c.start_date,
    c.target_location,
    c.campaign_socials,
    c.submitted_date,
    c.created_at,
    c.updated_at,
    c.call_to_action,
    c.target_audiences,
    c.target_regions,
    c.target_placements,
    c.cpi_rate,
    c.total_charged,
    c.billing_frequency,
    c.auto_pause_on_low_balance,
    c.minimum_balance_threshold,
    c.launched_at,
    c.ended_at,
    c.pause_reason,
    c.advertiser_id,
    c.brand_id,
    c.cancellation_fee_percent,
    c.campaign_budget,
    c.amount_used,
    c.remaining_balance,
    c.cancellation_fee_amount,
    c.cancelled_by_user_id,
    c.cancellation_reason,
    c.paused_at,
    c.grace_period_hours,
    c.deposit_percent,
    c.deposit_amount,
    c.outstanding_balance,
    c.total_impressions_planned,
    c.final_settlement_amount,
    c.national_location,
    c.national_country_code,
    c.regional_country_code,
    count(i.id) AS total_invoices,
    sum(i.impressions_delivered) AS total_impressions_billed,
    sum(
        CASE
            WHEN ((i.status)::text = 'paid'::text) THEN i.amount
            ELSE (0)::numeric
        END) AS total_paid,
    sum(i.outstanding_amount) AS total_outstanding,
    COALESCE(( SELECT true
           FROM public.campaign_invoices
          WHERE ((campaign_invoices.campaign_id = c.id) AND ((campaign_invoices.invoice_type)::text = 'deposit'::text) AND ((campaign_invoices.status)::text = 'paid'::text))
         LIMIT 1), false) AS deposit_paid,
    COALESCE(( SELECT true
           FROM public.campaign_invoices
          WHERE ((campaign_invoices.campaign_id = c.id) AND ((campaign_invoices.invoice_type)::text = 'final_settlement'::text) AND ((campaign_invoices.status)::text = 'paid'::text))
         LIMIT 1), false) AS final_settlement_paid,
    max(i.issued_at) AS last_billed_at,
    ( SELECT json_agg(json_build_object('id', campaign_invoices.id, 'invoice_number', campaign_invoices.invoice_number, 'type', campaign_invoices.invoice_type, 'amount', campaign_invoices.amount, 'impressions', campaign_invoices.impressions_delivered, 'cpi_rate', campaign_invoices.cpi_rate, 'status', campaign_invoices.status, 'due_date', campaign_invoices.due_date, 'paid_at', campaign_invoices.paid_at) ORDER BY campaign_invoices.issued_at DESC) AS json_agg
           FROM public.campaign_invoices
          WHERE (campaign_invoices.campaign_id = c.id)) AS invoices
   FROM (public.campaign_profile c
     LEFT JOIN public.campaign_invoices i ON ((c.id = i.campaign_id)))
  GROUP BY c.id;


